import {useState,useEffect} from 'react-router-dom'

function MemeList() {
    const [memes, setMemes] = useState([]);

    useEffect(() => {
      fetch('/memes')
        .then(res => res.json())
        .then(data => {
          setMemes(data);
        })
        .catch(err => {
          console.log(err);
        });
    }, []);

    const handleDelete = (id) => {
      fetch(`/memes/${id}`, { method: 'DELETE' })
        .then(res => res.json())
        .then(data => {
          console.log(data);
          setMemes(memes.filter(meme => meme.id !== id));
        })
        .catch(err => {
          console.log(err);
        });
    }

    return (
      <div>
        {memes.map(meme => (
          <div key={meme.id}>
            <Meme meme={meme} />
            <button onClick={() => handleDelete(meme.id)}>Delete Meme</button>
          </div>
        ))}
      </div>
    );
  }
export default MemeList
